import { Box, Container } from '@mui/material'
import React from 'react'

function BannerRegister() {
  return (
    <div>
      <Container
     
      >
        <img
        src="./background/background.jpg"
        alt="123"
        sx={{
            width:"100%"
        }}
        />
      </Container>
    </div>
  )
}

export default BannerRegister
